<template>
	<view class="extension">
		<view class="middle">
			<view class="title_top">{{ extensionObject.tg_title == '测试推广页标题' ? '推广分享获取永久免费观影' : extensionObject.tg_title }}</view>
		</view>
		<view class="code">
			<view class="title">{{ extensionObject.qrcode_title == '测试二维码标题' ? '' : extensionObject.tg_title }}</view>
			<view class="codeimage" ref="codeimage" id="codeimage">
					<tki-qrcode
						ref="qrcode"
						:val="extensionObject.url"
						size="300"
						lv="1"
						unit="upx"
						:onval="true"
						@result="qrR"
					/>
			</view>
			<view class="adv">{{ extensionObject.qrcode_advertisement }}</view>
		</view>
		<view class="invite">
			<view class="BF">
				<view class="store" @click="storeCode()">保存二维码</view>
				<view class="copy" @click="setClipboardData()">复制推广链接</view>
			</view>
			<view class="inviteContent">
				<view class="inviteList" v-for="(inviteListObject, index) in extensionObject.task_list" :key="index">
					<view class="left"><image src="../../static/29.png"></image></view>
					<view class="middle">
						<text class="num">{{ inviteListObject.name }}({{ extensionObject.invite_numbers }}/{{ inviteListObject.task_nums }})</text>
						<text class="time">{{ inviteListObject.title }}</text>
					</view>
					<view class="right" v-if="inviteListObject.is_finish == 0">未完成</view>
					<view class="right" v-if="inviteListObject.is_finish == 1">已完成</view>
				</view>
			</view>
		</view>
	</view>
</template>

<script>
import util from '../../utils/public';
import tkiQrcode from '@/components/tki-qrcode/tki-qrcode.vue';
/*引入生成二维码的工具*/
export default {
	components: {
		tkiQrcode
	},
	name: 'extension',
	data() {
		return {
			extensionObject: {}
		};
	},
	onLoad() {
		this.getUseInviteInfo();
	},
	onNavigationBarButtonTap(){
		uni.navigateTo({
			url:"../rulers/rulers"
		})
	},
	methods: {
		setClipboardData(){
			uni.setClipboardData({
				data:this.extensionObject.url,
			})
		},
		qrR(e){
			console.log(e);
		},
		async getUseInviteInfo() {
			const data = await util.getInfoByAxios(
				'post',
				`${util.config.host}/api/player/invitation_page`,
				{},
				true
			);
			console.log(data);
			this.extensionObject = data.data.data;
			// console.log(this.extensionObject.qrcode_advertisement);
		},
		storeCode() {
			this.$refs.qrcode._saveCode()
		},
		onCopy() {
			uni.showToast({
				title: '复制成功',
				icon: 'none'
			});
		},
		onError() {
			uni.showToast({
				title: '复制成功',
				icon: 'none'
			});
		}
	},
	filters: {
		prizeType(type) {
			if (type == '1') {
				return '天';
			} else if (type == '2') {
				return '月';
			}
		}
	}
};
</script>

<style scoped lang="scss">
.extension {
	width: 100%;
	background-image: url('data:image/jpg;base64,');
	background-size: 100% 100%;
	.title_top {
		font-size: 32upx;
		color: #333;
		text-align: center;
		padding-top: 30upx;
	}
	.code {
		width: 60%;
		margin: 5% auto;
		padding: 3%;
		/*background-color: #ffd5a7;*/
		background-color: white;
		border-radius: 0.5rem;
		display: flex;
		flex-wrap: wrap;
		align-items: center;
		view {
			color: #575757;
			letter-spacing: 0.1rem;
		}
		.title {
			width: 100%;
			font-size: 30upx;
			text-align: center;
		}
		.codeimage {
			width: 300upx;
			padding: 7%;
			margin: 0 auto;
			/*background-color: #f8ffd6;*/
			font-size: 0;
			image {
				width: 100%;
			}
		}
		.adv {
			width: 75%;
			margin: 0 auto;
			text-align: center;
			font-size: 30upx;
		}
	}
	.invite {
		width: 100%;
		.BF {
			width: 100%;
			display: flex;
			justify-content: space-around;
			view {
				width: 42%;
				height: 90upx;
				line-height: 90upx;
				font-size: 40upx;
				border-radius: 0.3rem;
				text-align: center;
				font-weight: bold;
			}
			.store {
				background-color: #c1825e;
				color: white;
			}
			.copy {
				border: 1px solid #c1825e;
				color: #c1825e;
			}
		}
		.inviteContent {
			width: 690upx;
			background-color: white;
			margin: 0 auto;
			margin-top:30upx;
			border-radius: 12upx;
			.inviteList {
				width:600upx;
				display: flex;
				align-items: center;
				justify-content: space-around;
				margin-bottom:40upx;
				.left {
					width:80upx;
					margin-left:30upx;
					image {
						width:80upx;
						height: 80upx;
					}
				}
				.middle {
					width: 350upx;
					margin-left:20upx;
					text {
						width: 100%;
						display: inline-block;
						text-align: left;
						font-size: 26upx;
					}
					.num {
					}
					.time {
						color: #ff6471;
					}
				}
				.right {
					width: 150upx;
					background-color: #ff6471;
					color: white;
					border-radius: 12upx;
					font-size: 30upx;
					line-height: 60upx;
					text-align: center;
					height: 60upx;
				}
			}
		}
	}
}
</style>
